  public final void yybegin(int newState) {
    zzLexicalState = newState;
  }


  /**
   * Returns the text matched by the current regular expression.
   */
  public final CharSequence yytext() {
    return zzBuffer.subSequence(zzStartRead, zzMarkedPos);
  }


  /**
   * Returns the character at position <tt>pos</tt> from the
   * matched text.
   *
   * It is equivalent to yytext().charAt(pos), but faster
   *
   * @param pos the position of the character to fetch.
   *            A value from 0 to yylength()-1.
   *
   * @return the character at position pos
   */
  public final char yycharat(int pos) {
    return zzBuffer.charAt(zzStartRead+pos);
  }


  /**
   * Returns the length of the matched text region.
   */
  public final int yylength() {
    return zzMarkedPos-zzStartRead;
  }


  /**
   * Reports an error that occured while scanning.
   *
   * In a wellformed scanner (no or only correct usage of
   * yypushback(int) and a match-all fallback rule) this method
   * will only be called with things that "Can't Possibly Happen".
   * If this method is called, something is seriously wrong
   * (e.g. a JFlex bug producing a faulty scanner etc.).
   *
   * Usual syntax/scanner level error handling should be done
   * in error fallback rules.
   *
   * @param   errorCode  the code of the errormessage to display
   */
  private void zzScanError(int errorCode) {
    String message;
    try {
      message = ZZ_ERROR_MSG[errorCode];
    }
    catch (ArrayIndexOutOfBoundsException e) {
      message = ZZ_ERROR_MSG[ZZ_UNKNOWN_ERROR];
    }

    throw new Error(message);
  }


  /**
   * Pushes the specified amount of characters back into the input stream.
   *
   * They will be read again by then next call of the scanning method
   *
   * @param number  the number of characters to be read again.
   *                This number must not be greater than yylength()!
   */
  public void yypushback(int number)  {
    if ( number > yylength() )
      zzScanError(ZZ_PUSHBACK_2BIG);

    zzMarkedPos -= number;
  }


  /**
   * Resumes scanning until the next regular expression is matched,
   * the end of input is encountered or an I/O-Error occurs.
   *
   * @return      the next token
   * @exception   java.io.IOException  if any I/O-Error occurs
   */
  public IElementType advance() throws java.io.IOException {
    int zzInput;
    int zzAction;

    // cached fields:
    int zzCurrentPosL;
    int zzMarkedPosL;
    int zzEndReadL = zzEndRead;
    CharSequence zzBufferL = zzBuffer;

    int [] zzTransL = ZZ_TRANS;
    int [] zzRowMapL = ZZ_ROWMAP;
    int [] zzAttrL = ZZ_ATTRIBUTE;

    while (true) {
      zzMarkedPosL = zzMarkedPos;

      if (zzMarkedPosL > zzStartRead) {
        switch (zzBufferL.charAt(zzMarkedPosL-1)) {
        case '\n':
        case '\u000B':  // fall though
        case '\u000C':  // fall though
        case '\u0085':  // fall though
        case '\u2028':  // fall though
        case '\u2029':  // fall though
          zzAtBOL = true;
          break;
        case '\r': 
          if (zzMarkedPosL < zzEndReadL)
            zzAtBOL = zzBufferL.charAt(zzMarkedPosL) != '\n';
          else if (zzAtEOF)
            zzAtBOL = false;
          else {
            boolean eof = zzRefill();
            zzMarkedPosL = zzMarkedPos;
            zzEndReadL = zzEndRead;
            zzBufferL = zzBuffer;
            if (eof) 
              zzAtBOL = false;
            else 
              zzAtBOL = zzBufferL.charAt(zzMarkedPosL) != '\n';
          }
          break;
        default:
          zzAtBOL = false;
        }
      }
      zzAction = -1;

      zzCurrentPosL = zzCurrentPos = zzStartRead = zzMarkedPosL;

      if (zzAtBOL)
        zzState = ZZ_LEXSTATE[zzLexicalState+1];
      else
        zzState = ZZ_LEXSTATE[zzLexicalState];

      // set up zzAction for empty match case:
      int zzAttributes = zzAttrL[zzState];
      if ( (zzAttributes & 1) == 1 ) {
        zzAction = zzState;
      }


      zzForAction: {
        while (true) {

          if (zzCurrentPosL < zzEndReadL) {
            zzInput = Character.codePointAt(zzBufferL, zzCurrentPosL/*, zzEndReadL*/);
            zzCurrentPosL += Character.charCount(zzInput);
          }
          else if (zzAtEOF) {
            zzInput = YYEOF;
            break zzForAction;
          }
          else {
            // store back cached positions
            zzCurrentPos  = zzCurrentPosL;
            zzMarkedPos   = zzMarkedPosL;
            boolean eof = zzRefill();
            // get translated positions and possibly new buffer
            zzCurrentPosL  = zzCurrentPos;
            zzMarkedPosL   = zzMarkedPos;
            zzBufferL      = zzBuffer;
            zzEndReadL     = zzEndRead;
            if (eof) {
              zzInput = YYEOF;
              break zzForAction;
            }
            else {
              zzInput = Character.codePointAt(zzBufferL, zzCurrentPosL/*, zzEndReadL*/);
              zzCurrentPosL += Character.charCount(zzInput);
            }
          }
          int zzNext = zzTransL[ zzRowMapL[zzState] + ZZ_CMAP(zzInput) ];
          if (zzNext == -1) break zzForAction;
          zzState = zzNext;

          zzAttributes = zzAttrL[zzState];
          if ( (zzAttributes & 1) == 1 ) {
            zzAction = zzState;
            zzMarkedPosL = zzCurrentPosL;
            if ( (zzAttributes & 8) == 8 ) break zzForAction;
          }

        }
      }

      // store back cached position
      zzMarkedPos = zzMarkedPosL;

      if (zzInput == YYEOF && zzStartRead == zzCurrentPos) {
        zzAtEOF = true;
        switch (zzLexicalState) {
            case PREREQUISITES: {
              yypushback(yylength()); yybegin(YYINITIAL); return EOL;
            }  // fall though
            case 929: break;
            case INCLUDES: {
              yypushback(yylength()); yybegin(YYINITIAL); return EOL;
            }  // fall though
            case 930: break;
            case EXPORT: {
              yypushback(yylength()); yybegin(YYINITIAL); return EOL;
            }  // fall though
            case 931: break;
            case EXPORTVAR: {
              yypushback(yylength()); yybegin(YYINITIAL); return EOL;
            }  // fall though
            case 932: break;
            default:
        return null;
        }
      }
      else {
        switch (zzAction < 0 ? zzAction : ZZ_ACTION[zzAction]) {
          case 1: 
            { return IDENTIFIER;
            } 
            // fall through
          case 46: break;
          case 2: 
            { return WHITE_SPACE;
            } 
            // fall through
          case 47: break;
          case 3: 
            { return COMMENT;
            } 
            // fall through
          case 48: break;
          case 4: 
            { yybegin(PREREQUISITES); return COLON;
            } 
            // fall through
          case 49: break;
          case 5: 
            { yybegin(SOURCE); return ASSIGN;
            } 
            // fall through
          case 50: break;
          case 6: 
            { return BAD_CHARACTER;
            } 
            // fall through
          case 51: break;
          case 7: 
            { yybegin(SOURCE); return TAB;
            } 
            // fall through
          case 52: break;
          case 8: 
            { yybegin(YYINITIAL); return EOL;
            } 
            // fall through
          case 53: break;
          case 9: 
            { return COLON;
            } 
            // fall through
          case 54: break;
          case 10: 
            { yybegin(SOURCE); return SEMICOLON;
            } 
            // fall through
          case 55: break;
          case 11: 
            { return PIPE;
            } 
            // fall through
          case 56: break;
          case 12: 
            { yypushback(yylength()); yybegin(YYINITIAL); return WHITE_SPACE;
            } 
            // fall through
          case 57: break;
          case 13: 
            { return LINE;
            } 
            // fall through
          case 58: break;
          case 14: 
            { yybegin(YYINITIAL); return WHITE_SPACE;
            } 
            // fall through
          case 59: break;
          case 15: 
            { yybegin(DEFINEBODY); return WHITE_SPACE;
            } 
            // fall through
          case 60: break;
          case 16: 
            { return ASSIGN;
            } 
            // fall through
          case 61: break;
          case 17: 
            { return VARIABLE_VALUE_LINE;
            } 
            // fall through
          case 62: break;
          case 18: 
            { yybegin(YYINITIAL); return CONDITION;
            } 
            // fall through
          case 63: break;
          case 19: 
            { return FUNCTION_PARAM_TEXT;
            } 
            // fall through
          case 64: break;
          case 20: 
            { yybegin(YYINITIAL); return FUNCTION_END;
            } 
            // fall through
          case 65: break;
          case 21: 
            { yybegin(EXPORTVAR); return ASSIGN;
            } 
            // fall through
          case 66: break;
          case 22: 
            { return DOC_COMMENT;
            } 
            // fall through
          case 67: break;
          case 23: 
            { yybegin(PREREQUISITES); return DOUBLECOLON;
            } 
            // fall through
          case 68: break;
          case 24: 
            { return SPLIT;
            } 
            // fall through
          case 69: break;
          case 25: 
            { return DOUBLECOLON;
            } 
            // fall through
          case 70: break;
          case 26: 
            { return VARIABLE_USAGE;
            } 
            // fall through
          case 71: break;
          case 27: 
            { return MACRO;
            } 
            // fall through
          case 72: break;
          case 28: 
            { yybegin(FUNCTION); return FUNCTION_NAME_TOKEN;
            } 
            // fall through
          case 73: break;
          case 29: 
            { yybegin(CONDITIONALS); return KEYWORD_IFEQ;
            } 
            // fall through
          case 74: break;
          case 30: 
            { yybegin(ELSE); return KEYWORD_ELSE;
            } 
            // fall through
          case 75: break;
          case 31: 
            { yybegin(CONDITIONALS); return KEYWORD_IFNEQ;
            } 
            // fall through
          case 76: break;
          case 32: 
            { yybegin(CONDITIONALS); return KEYWORD_IFDEF;
            } 
            // fall through
          case 77: break;
          case 33: 
            { return KEYWORD_ENDIF;
            } 
            // fall through
          case 78: break;
          case 34: 
            { yybegin(INCLUDES); return KEYWORD_VPATH;
            } 
            // fall through
          case 79: break;
          case 35: 
            { yybegin(YYINITIAL); return KEYWORD_ENDEF;
            } 
            // fall through
          case 80: break;
          case 36: 
            { yybegin(CONDITIONALS); return KEYWORD_IFNDEF;
            } 
            // fall through
          case 81: break;
          case 37: 
            { yybegin(DEFINE); return KEYWORD_DEFINE;
            } 
            // fall through
          case 82: break;
          case 38: 
            { yybegin(EXPORT); return KEYWORD_EXPORT;
            } 
            // fall through
          case 83: break;
          case 39: 
            { yybegin(YYINITIAL); return KEYWORD_EXPORT;
            } 
            // fall through
          case 84: break;
          case 40: 
            { return KEYWORD_PRIVATE;
            } 
            // fall through
          case 85: break;
          case 41: 
            { yybegin(INCLUDES); return KEYWORD_INCLUDE;
            } 
            // fall through
          case 86: break;
          case 42: 
            { yybegin(YYINITIAL); return KEYWORD_PRIVATE;
            } 
            // fall through
          case 87: break;
          case 43: 
            { yybegin(INCLUDES); return KEYWORD_UNDEFINE;
            } 
            // fall through
          case 88: break;
          case 44: 
            { return KEYWORD_OVERRIDE;
            } 
            // fall through
          case 89: break;
          case 45: 
            { yybegin(YYINITIAL); return KEYWORD_OVERRIDE;
            } 
            // fall through
          case 90: break;
          default:
            zzScanError(ZZ_NO_MATCH);
          }
      }
    }
  }


